    [],nt"revision_timestamp": "2013-03-15T21:26:05.245777",nt"name": "digital-data-sets-that-describe-aquifer-characteristics-of-the-central-oklahoma-aquifer-in-centf0885",nt"isopen":
    false,nt"url": null,nt"notes": "This data set consists of digitized aquifer
    boundaries created for a previously published report about the Central Oklahoma
    aquifer in central Oklahoma. This area encompasses all or part of Cleveland, Lincoln,
    Logan, Oklahoma, Payne, and Pottawatomie Counties. The Central Oklahoma aquifer
    includes the alluvial and terrace deposits along major streams, the Garber Sandstone
    and Wellington Formations, and the Chase, Council Grove, and Admire Groups. The
    Quaternary-age alluvial and terrace deposits consist of unconsolidated clay, silt,
    sand, and gravel. The Permian-age Garber Sandstone and Wellington Formations consist
    of sandstone with interbedded siltstone and mudstone. The Permian-age Chase, Council
    Grove, and Admire Groups consist of sandstone, shale, and thin limestone. The Central
    Oklahoma aquifer underlies about 3,000 square miles of central Oklahoma where the
    aquifer is used extensively for municipal, industrial, commercial, and domestic
    water supplies. Most of the usable ground water within the aquifer is from the Garber
    Sandstone and Wellington Formations. Substantial quantities of usable ground water
    also are present in the Chase, Council Grove, and Admire Groups, and in alluvial
    and terrace deposits associated with the major streams.",nt"license_title":
